import React from 'react'


const styles = {
    ul: {
        listStyle: 'none',
        margin : 0,
        padding : 0
    }
  }

export default function Lista (){
    return(
        <ul style = {styles.ul}>
            <li>Sport</li>
            <li>Sport Touring</li>
            <li>Enduro</li>  

        </ul> 

    )
}
